import { useState } from "react";
import BlogList from "./BlogList";

const Home = () => {
  const [blogs, setBlogs] = useState([
    { title: 'My new website', body: 'lorem ipsum...', author: 'aws', id: 1 },
    { title: 'Welcome party!', body: 'lorem ipsum...', author: 'gcp', id: 2 },
    { title: 'Web dev top tips', body: 'lorem ipsum...', author: 'azure', id: 3 }
  ])

  return (
    <div className="home">
      <BlogList blogs={blogs} title="All Blogs" />
      <BlogList blogs={blogs.filter(blog => blog.author === 'mario')} title="Mario's Blogs" />
    </div>
  );
}

export default Home;
